import React, { useEffect, useState, Fragment } from "react";

import { Heading, Container, SubHeading, Button, Span } from "./styles";
import { useParams, useHistory } from "react-router-dom";
import Typist from "react-typist";

const PersonBio = () => {
  const { id }: any = useParams();
  const history = useHistory();

  const [personInfo, setPersonInfo] = useState<any[]>([]);
  /*
  const loadData = async () => {
    const response = await fetch(`https://swapi.dev/api/people/${id}`);
    const data = await response.json();
    setPersonInfo(data);
    console.log(data);
  };*/

  useEffect(() => {
    fetch(`https://swapi.dev/api/people/${id}`)
      .then((res) => res.json())
      .then((data) => console.log(data));
    /*loadData();*/
  }, []);

  const goBack = () => {
    history.goBack();
  };

  return (
    <>
      <Fragment>
        {personInfo.map((person) => (
          <h2>{person.name}</h2>
        ))}
        <Heading>
          PersonBio : <Span> {id} </Span>
        </Heading>

        <Container>
          <Typist>
            <SubHeading>
              <Typist.Delay ms={500} /> Name :
            </SubHeading>
          </Typist>

          <Typist>
            <SubHeading>
              {" "}
              <Typist.Delay ms={800} />
              Gender :
            </SubHeading>
          </Typist>

          <Typist>
            <SubHeading>
              <Typist.Delay ms={900} /> Mass :
            </SubHeading>
          </Typist>
          <Typist>
            <SubHeading>
              <Typist.Delay ms={1000} /> Height :
            </SubHeading>
          </Typist>

          <Typist>
            <SubHeading>
              <Typist.Delay ms={1200} /> Homeworld :
            </SubHeading>
          </Typist>

          <Button onClick={goBack}> Back</Button>
        </Container>
      </Fragment>
    </>
  );
};

export default PersonBio;
